import axios from "axios";
import { GET_ERRORS, GET_PROJECTS} from "./type";
export const createProject = (document, history) => async dispatch => {
  try {
    const response = await axios.post("http://localhost:9090/tdms/document", document);
    history.push("/dashboard");
  } catch (error) {
    dispatch({
      type: GET_ERRORS,
      payload: error.response.data
    });
  }
};

export const getDocuments = () => async dispatch => {
  const response = await axios.get("http://localhost:9090/tdms/topics");
  dispatch({
    type: GET_DOCUMENTS,
    payload: response.data
  });
};
